import employeeService from "../service/employeeService";

import { SHOW_EMPLOYEE_DETAIL } from "./type";

export const employeeDetail = () => async(dispatch)=>{
    try {
        const res = await employeeService.detail()
        dispatch({
            type: SHOW_EMPLOYEE_DETAIL,
            payload: res.data
        })
    } catch (error) {
        console.log(error);
    }
}
